import { useEffect, useState } from "react";
import { Patient } from "./interfaces";
import { Specialization } from "./interfaces";

interface Props {
	patient: Patient | null
}

export const SpecializationBookingForm = (props: Props) => {

  const [specializations, setSpecializations] = useState<Specialization[] | []>([]);

  useEffect(() => {
		console.log("props",props)
    const fetchFacilities = async () => {
      try {
        const response = await fetch("http://localhost:8080/api/specialization");
        const data = await response.json();
        setSpecializations(data);
				// setSelectedFacility(facilities[0])
      } catch (error) {
        console.log(error);
      }
    };
    fetchFacilities();
  }, []);

  const handleFormSubmit = (event: any) => {
      event.preventDefault();
      // TODO: add logic to submit form based on booking option
    };

  return (
    <div>
      <h3>Book by Specialization</h3>
      <form onSubmit={handleFormSubmit}>
        <label htmlFor="specialization">Select a Specialization:</label>
        <select id="specialization" name="specialization">
          <option value="specialization1">Specialization 1</option>
          <option value="specialization2">Specialization 2</option>
          <option value="specialization3">Specialization 3</option>
        </select>
        <button type="submit">Book Appointment</button>
      </form>
    </div>
  );
};
